import TwoUp from '../components/TwoUp'
// import ProTip from '../src/ProTip';
// import Link from '../src/Link';
// import Copyright from '../src/Copyright';

export default function Index() {
  return (
    <Container maxWidth="sm">
      <Box my={4}>
        <TwoUp />
        <SimpleBottomNavigation />

      </Box>
    </Container>
  );
}
